#include <iostream>
#include <vector>
#include <algorithm>
#include <string>
#include <set>
#include <bitset>
#include <cmath>
#include <unordered_map>
#include <queue>
#include <functional>
#include <cstring>
using namespace std;

#define FOR(i,n) for(ll i=0; i<(n); i++)
#define endl "\n"
#define ll unsigned long long

const int MAX = 100001;
ll N;
ll h[MAX];

void input()
{
	ios::sync_with_stdio(false);
	cin.tie(NULL);
	cout.tie(NULL);

	cin >> N;
	if (N == 0) return;

	FOR(i, N)
	{
		cin >> h[i];
	}

}

ll calcWidth(ll begin, ll end)
{
	if (begin > end) return 0;
	if (begin == end) return h[end];

	ll mid = (begin + end) / 2;
	ll ret = max(calcWidth(begin, mid), calcWidth(mid + 1, end));

	ll left = mid, right = mid + 1;
	ll height = min(h[left], h[right]);
	ret = max(ret, height * 2);

	while (begin < left || right < end)
	{
		if (right < end && (left == begin || h[left - 1] < h[right + 1]))
		{
			++right;
			height = min(height, h[right]);
		}
		else
		{
			--left;
			height = min(height, h[left]);
		}
		ret = max(ret, height*(right - left + 1));
	}
	//cout << ret << endl;
	return ret;
}

void solve()
{
	ll ans = calcWidth(0,N-1);
	cout << ans << endl;
}

int main()
{
	while (true)
	{
		input();
		if (N == 0) return 0;

		solve();
	}
	return 0;
}

